import pytestfrom beopWeb.mod_admin import controllersfrom beopWeb.mod_admin.FavoriteProject import FavoriteProject@pytest.mark.p0@pytest.mark.parametrize(('user_id'), [    (2265),])def test_remove_favorite_project(user_id):    req={"projectId":49}    controllers.do_set_favorite_project(user_id,req)    controllers.do_remove_favorite_project(user_id)    fp = FavoriteProject(user_id)    project_id=fp.get_favorite_project()    assert project_id==None,'remove favorite project fail'